  [],\n\t\"revision_timestamp\": \"2016-07-27T22:58:13.059786\",\n\t\"name\": \"movements-of-a-loggerhead-sea-turtle-found-on-back-bay-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Nesting females were monitored on the beach
  between Sandbridge and the North Carolina state line by personnel from the Back
  Bay National Wildlife Refuge (BBNWR). On 8 July 1993 a female was found crawling
  toward the ocean. She was constrained to prevent escape, then weighed and measured.
  The turtle weighed 230 Ibs., and the straight midline carapace length was 88.3 cm.
  A satellite transmitter (Telonics model ST-3) was affixed to the carapace of the
  turtle with plastic resin, a non-invasive procedure (Figure I). We have utilized
  this method successfully on over 15 turtles (Keinath, 1993). The turtle was then
  released at BBNWR that morning (Figure 2), and movements and behavior were monitored
  until positions were no longer received. Travel routes were plotted using the computer
  program Mapinfo.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
